import React from 'react';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Homes from './pages/Homes';


const App = () => {
  return (
    <BrowserRouter>
    <Routes>
      <Route path='/' element={<Homes />}/>
      <Route path='/ab' element={<Homes />}/>
    </Routes>
    </BrowserRouter>
  )
}

export default App
